    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from September through December of 1949. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include fur harvesting. The
    public relations section of the report describes recreational uses, Refuge visitors,
    and Refuge participation. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
